import React from "react";
import KanbanTable from "./components/KanbanTable";
import Column from "./components/Column";
import Card from "./components/Card";

function App() {
  return (
    <KanbanTable>
      <Column
        header="ToDo"
        cardData={["testidata", "testidata2", "testidata234"]}
      />
      <Column
        header="In Progress"
        cardData={["testidata", "testidata2", "testidata234"]}
      />
      <Column cardData={["testidata", "testidata2", "testidata234"]} />
    </KanbanTable>
  );
}

export default App;
